import React from "react";
import '../images/map1.svg';
import '../images/map2.svg';

class Map extends React.Component {
  constructor(props){
    super(props)
  }

  render() {
    return(
      <img src={`../images/map${this.props.floor.svg}`} alt='map'/>
    )
  }
}

export default Map;
